	layer[3] = model.hook(Conv2D(32, kernel(1,3), stride(1,1), dilation(1,1), PADDING_VALID, &conv1d_1_w, &conv1d_1_b), layer[2]);
	layer[4] = model.active(act_relu(), layer[3]);
	layer[5] = model.hook(Dense(32, &dense_w, &dense_b), layer[4]);
